import React, {memo} from 'react';
import styled from 'styled-components';

import Title from '../../components/TitleContainer';

const IndexContainer = styled.div`
    width:100%;
`;

const index = memo(() => {
    return (
        <IndexContainer>
            <Title />
        </IndexContainer>
    );
});

export default index;
